def solve(self, board):
    """
    :type board: List[List[str]]
    :rtype: void Do not return anything, modify board in-place instead.
    """
    import sys
    sys.setrecursionlimit(15000)

    height = len(board)
    width = len(board[0])
    dirs = [(1,0),(0,1),(-1,0),(0,-1)]

    visited = [[False for i in range(width)] for j in range(height)]
    marker = 0

    def recursion(cur):
        
        if visited[cur[0]][cur[1]] == False:
            visited[cur[0]][cur[1]] = True
            if board[cur[0]][cur[1]] == 'O':
                board[cur[0]][cur[1]] = marker
                for d in dirs:
                    nr = cur[0] + d[0]
                    nc = cur[1] + d[1]

                    if nr < 0 or nr >= height or nc < 0 or nc >= width:
                        return 'out'
                    #elif board[nr][nc] == 'O':
                    else:
                        result = recursion((nr, nc))
                        if result == 'out':
                            return 'out'
                    
                #visited[cur[0]][cur[1]] = False
    

    for i in range(height):
        for j in range(width):
            if visited[i][j] == False and board[i][j] == 'O':
                marker += 1
                result = recursion((i, j))
                #print(result)
                if result == None:
                    for ii in range(height):
                        for jj in range(width):
                            if board[ii][jj] == marker:
                           
                                board[ii][jj] = 'X'

    for ii in range(height):
        for jj in range(width):
            if board[ii][jj] != 'O' and board[ii][jj] != 'X':
                board[ii][jj] = 'O'

    return board


